import React from 'react';
import email from './assets/mail-bulk-solid.svg';
import {
  ICON_ALT,
  MAIN_IMAGE_ALT,
  WEBSITE_EMAIL,
  WEBSITE_EMAIL_LINK,
  WEBSITE_TITLE,
} from './constants';
import image from './assets/rachel-in-studio.jpg';

function App() {
  return (
    <div className="flex justify-center items-center h-screen w-screen flex-row bg-red-900">
      <header className="flex flex-col gap-y-8 text-center text-6xl relative z-10 flex-1">
        <span className="font-pathway uppercase font-black text-gray-100 opacity-80 shadow-2xl">
          {WEBSITE_TITLE}
        </span>
        <p className="flex gap-x-2">
          <img src={email} alt={ICON_ALT} className="w-8 h-8" />
          <a href={WEBSITE_EMAIL_LINK} className="text-xl font-arvo">
            {WEBSITE_EMAIL}
          </a>
        </p>
      </header>
      <img src={image} alt={MAIN_IMAGE_ALT} className="h-screen rotate-12" />
    </div>
  );
}

export default App;
